import React from 'react'

const UserList = (props) => {
    console.log(props.users);
    return (
        <ul>
            {props.users.map(user => {
                return (
                    <>
                        <li>{user.fname}</li>
                        <li>{user.sname}</li>
                    </>
                )
            })}
            <div>UserList</div>
        </ul>
    )
}

export default UserList
